import React, {useState} from 'react'
import stickersData from './AuctionStikers-data'

function Sticker(props){

  const [index, setIndex] = useState(props.index)
  return(
    <div>
      <img src={stickersData.index.image} />
      <div>
        <img src={stickersData.index.profile.avatar} alt="avatar" />
        <span>{stickersData.index.profile.nickname}</span>
      </div>
      <h5>{stickersData.index.stickname}</h5>
    </div>
  )
}

export default Sticker
